import React from "react";
import styles from "./ProjectInfo.module.scss";
import { Link } from 'react-router-dom';

const ProjectInfo = ({ data }) => {
  return (
    <div className={styles.info}>
      <h3 className={styles.info_title}>{data?.name}</h3>
      <p className={styles.info_desk}>{data?.descripton}</p>
      {/* <Link className={styles.info_btn} to={data?.reference}>Посмотреть сайт</Link> */}
      <a href="https://example.com/other-project" target="_blank" class={styles.info_btn}>Посмотреть другой проект</a>
    </div>
  );
};

export default ProjectInfo;
